import React from 'react';
import styles from './Job.module.css';

const Job = props => {
  return (
    <div className={styles.Job}>
      <div className={styles.MainInfo}>
        <div className={styles.JobName}>{props.data.name}</div>
        <div className={styles.JobType}>{props.data.jobType}</div>
      </div>
      <div className={styles.JobInfo}>
        <div>
          <div className={styles.InfoTitle}>TYPE OF SHIFTS</div>
          <div className={styles.ShiftName}>{props.data.shiftType}</div>
        </div>
        <div>
          <div className={styles.InfoTitle}>BEGIN</div>
          <div className={styles.ShiftName}>{props.data.shiftType}</div>
        </div>
      </div>
      <div className={styles.JobActions}>ID: {props.data.id}</div>
    </div>
  );
};

export default Job;
